class Solution:
    def wall(self, N: int) -> str:
        # Brute Force with memoization
        # Time complexity: O(n^2)
        # Space Complexity: O(1)
        def wall_helper(N, part, height):
            if N == 0:
                return "NO"
            if part == N:
                return "YES"
            if part > 0:
                # Bottom part
                if part % 2 == 0:
                    height += part
                    part += 2
                    if part >= N:
                        part = 1
                    return wall_helper(N, part, height)

                # Top part
                if part % 2 == 1:
                    height += part
                    part += 1
                    if part >= N:
                        part = N
                    return wall_helper(N, part, height)
            else:
                # Right part
                if height % 2 == 0:
                    height += height // 2
                    part += 1
                    if height >= N:
                        part = 1
                    return wall_helper(N, part, height)
                # Left part
                else:
                    height += height // 2
                    part += 1
                    if height >= N:
                        part = N
                    return wall_helper(N, part, height)

        return wall_helper(N, 0, 0)

